import React from "react";
import logo, { ReactComponent } from "./logo.svg";
import "./App.css";

class Header extends Component {
  render() {
    return (
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>こんにちは世界！</h1>
      </header>
    );
  }
}

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Header />
        <p>Learn React NOW!</p>
      </div>
    );
  }
}

export default App;
